function HomePageText(props){
    return (
        <div className="hero-info">
            <div className="hero-name">
                <h1>Nathan Do</h1>
                <p>[nay-than-doe]</p>
            </div>
            <div className="hero-list">
                <p>web developer, product designer</p>
                <ol>
                    <li>attends the <span>University of Washington</span> studying Informatics</li>
                    <li>web developer @ Ignite Robotics</li>
                    <li>also...</li>
                </ol>
            </div>
        </div>
    )
}

function HomeToAboutButton(props){
    return (
        <a href="" className="hero-learn">
            <h2>learn more about me</h2>
            <img src="./img/arrow-right.svg"/>
        </a>
    )
}

export function HomePage(props) {
    return (
        <div className="hero-container">
            <div className="hero">
                <HomePageText/>
                <HomeToAboutButton/>
            </div>
        </div>
    )
}
